DROP PROCEDURE IF EXISTS `SP_Contar_Empleados_Sucursal`;
DELIMITER |
CREATE PROCEDURE `SP_Contar_Empleados_Sucursal`()
BEGIN
	#Routine body goes here...
	
	SELECT tbsucursales.sucursal AS sucursal,
					(SELECT COUNT(tbempleados.nombre)
					FROM tbempleados
					WHERE tbempleados.idsucursal = tbsucursales.idsucursal AND tbempleados.activo = 1) 
				AS cantidad
	FROM tbsucursales ORDER BY idsucursal

;END |
