DROP PROCEDURE IF EXISTS `SP_Mostrar_Empleados`;
DELIMITER |
CREATE PROCEDURE `SP_Mostrar_Empleados`(IN `xopcion` int(2), IN `xidsociedad` int(2),IN `xidsucursal` int(2),IN `xactivo` int(1),IN `xnombre` varchar(50))
BEGIN
	#Routine body goes here...
	# Opcion 1 = Todos
	# Opcion 2 = Activos / Desactivos
	# Opcion 3 = Sucursal	
	# Opcion 4 = Nombre
	
	SELECT		
		tbempleados.codigo as Codigo,
		CONCAT(tbempleados.nombre," ",tbempleados.apellidos) as nombrecompleto,
		tbempleados.nombre as Nombre,
		tbempleados.apellidos as Apellidos,
		tbsucursales.sucursal as Sucursal,	
		tbempleados.iddepto as iddepto,
		tbdeptos.nombre as Departamento,
		tbempleados.idhorario as idhorario,
		CONCAT(tbhorarios.hrentrada, " - ", tbhorarios.hrsalida) AS Horario,
		tbempleados.foto as Foto,
		tbempleados.activo as Activo,
		tbempleados.tienehuella as Huella,
		tbempleados.descansos as numerodias,
		tbempleados.diasdescansos as Diasdescansos,
		tbempleados.idsucursal as idsucursal,
		tbempleados.pinactivo as pinactivo,
		tbempleados.pin as pin,
		tbempleados.estadoreg as estadoreg,
		tbempleados.fultimoreg as fultimoreg,
		tbempleados.fmodifica as fechamodifica,
		tbempleados.fingreso as fechaingreso
	FROM tbempleados
	INNER JOIN tbdeptos ON tbempleados.iddepto = tbdeptos.iddepto
	INNER JOIN tbhorarios ON tbempleados.idhorario = tbhorarios.idhorario
	INNER JOIN tbsucursales ON tbempleados.idsucursal = tbsucursales.idsucursal	
	WHERE 
		CASE xopcion
			WHEN 1 THEN tbempleados.idsociedad = xidsociedad
			WHEN 2 THEN tbempleados.activo = xactivo		
			WHEN 3 THEN tbempleados.idsucursal = xidsucursal
			WHEN 4 THEN CONCAT(tbempleados.nombre, tbempleados.apellidos) LIKE CONCAT('%',xnombre,'%') COLLATE utf8_unicode_ci
		END AND tbempleados.activo = xactivo 
	ORDER BY tbempleados.codigo
	LIMIT 1000

;END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `SP_Mostrar_Empleados_Detalle`;
DELIMITER |
CREATE PROCEDURE `SP_Mostrar_Empleados_Detalle`(IN `xopcion` int(2),IN `xidsociedad` int(1),IN `xactivo` int(1),IN `xidsucursal` int(2),IN `xcodigo` varchar(4),IN `xnombre` varchar(150),IN `xiddepto` int(2),IN `xidhorario` int(2))
BEGIN
	#Routine body goes here...
	
	SELECT * FROM v_detalles_empleados
	WHERE
		CASE xopcion
			WHEN 1 THEN idsociedad = xidsociedad
			WHEN 2 THEN activo = xactivo
			WHEN 3 THEN idsucursal = xidsucursal
			WHEN 4 THEN codigo = xcodigo COLLATE utf8_unicode_ci
			WHEN 5 THEN nombrecompleto LIKE CONCAT('%',xnombre,'%') COLLATE utf8_unicode_ci
			WHEN 6 THEN iddepto = xiddepto
