DELIMITER |
CREATE PROCEDURE `SP_Mostrar_Observaciones`(IN `xopcion` int(1),IN `xfechaini` date,IN `xfechafin` date, IN	`xidsucursal` INT(2))
BEGIN
	#Routine body goes here...
	
	SELECT tbobservaciones.idobservacion as idobservacion, 
				 tbobservaciones.general as general, 
				 tbobservaciones.codigo as codigoobs, 
				 tbobservaciones.fecha as fecha, 
				 tbobservaciones.observacion as observacion,				 
				 CASE WHEN general = 1 THEN "GENERAL" ELSE CONCAT(tbempleados.nombre," ",tbempleados.apellidos) END as nombre,
				 tbobservaciones.idsucursal as idsucursal,
				 tbsucursales.sucursal as sucursal,
				 tbobservaciones.sync as sync
	FROM tbobservaciones
	LEFT JOIN tbempleados ON tbobservaciones.codigo = tbempleados.codigo
	LEFT JOIN tbsucursales ON tbobservaciones.idsucursal = tbsucursales.idsucursal
	WHERE 
		CASE xopcion
			WHEN 1 THEN tbobservaciones.idsociedad = 1
			WHEN 2 THEN tbobservaciones.fecha BETWEEN xfechaini AND xfechafin
			WHEN 3 THEN tbobservaciones.sync = 0 AND tbobservaciones.fecha BETWEEN xfechaini AND xfechafin
			WHEN 4 THEN tbobservaciones.idsucursal = xidsucursal
			WHEN 5 THEN tbobservaciones.idsucursal = xidsucursal and tbobservaciones.fecha BETWEEN xfechaini AND xfechafin
			WHEN 6 THEN tbobservaciones.sync = 0
		END
	ORDER BY fecha DESC
	
	
;END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `SP_Mostrar_Registros`;
DELIMITER |
CREATE PROCEDURE `SP_Mostrar_Registros`(IN `xopcion` int,IN `xsync` int,IN `xfechaini` date,IN `xfechafin` date,IN `xidsucursal` int,IN `xcodigo` varchar(4),IN `xiddepto` int)
BEGIN
	#Routine body goes here...
	
	SELECT 
		tbregistros.idregistros AS idregistro,
		tbregistros.codigo AS codigo,
		CONCAT(tbempleados.nombre," ",tbempleados.apellidos) AS nombrecompleto,
		tbregistros.fechahorareg AS fechahorareg,
		DATE(tbregistros.fechahorareg) AS fecha, 
		TIME(tbregistros.fechahorareg) AS hora,
		tbregistros.`status` AS idestado,
		(CASE tbregistros.`status` WHEN 1 THEN "ENTRADA" WHEN 2 THEN "SALIDA" END) AS estado,
		tbregistros.idsucursal AS idsucursal,
		tbsucursales.sucursal AS sucursal
	FROM tbregistros
	LEFT JOIN tbempleados ON tbregistros.codigo = tbempleados.codigo
	LEFT JOIN tbsucursales ON tbregistros.idsucursal = tbsucursales.idsucursal
	WHERE
		CASE xopcion
			WHEN 1 THEN tbregistros.idsociedad = 1 AND tbregistros.fechahorareg BETWEEN xfechaini AND DATE_ADD(xfechafin,INTERVAL 1 DAY)
			WHEN 2 THEN sync = xsync
			WHEN 3 THEN tbregistros.fechahorareg BETWEEN xfechaini AND DATE_ADD(xfechafin,INTERVAL 1 DAY)
			WHEN 4 THEN tbempleados.idsucursal = xidsucursal AND tbregistros.fechahorareg BETWEEN xfechaini AND DATE_ADD(xfechafin,INTERVAL 1 DAY)
			WHEN 5 THEN tbregistros.codigo = xcodigo AND tbregistros.fechahorareg BETWEEN xfechaini AND DATE_ADD(xfechafin,INTERVAL 1 DAY)
			WHEN 6 THEN tbregistros.codigo = xcodigo BETWEEN xfechaini AND DATE_ADD(xfechafin,INTERVAL 1 DAY)
			WHEN 7 THEN tbempleados.iddepto = xiddepto AND tbregistros.fechahorareg BETWEEN xfechaini AND DATE_ADD(xfechafin,INTERVAL 1 DAY)
			WHEN 8 THEN tbempleados.idsucursal = xidsucursal AND tbempleados.iddepto = xiddepto AND tbregistros.fechahorareg BETWEEN xfechaini AND DATE_ADD(xfechafin,INTERVAL 1 DAY)
		END
		AND tbregistros.activo = 1 AND tbempleados.activo = 1		
	ORDER BY codigo, fechahorareg
	
;END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `SP_Mostrar_Registros_Asistencias`;
DELIMITER |
CREATE PROCEDURE `SP_Mostrar_Registros_Asistencias`(IN `xopcion` int(1),IN `xfechaini` date,IN `xfechafin` date, IN `xidsucursal` int(2), IN `xiddepto` int(2), IN `xcodigo` VARCHAR(4))
BEGIN
	#Routine body goes here...
	# opcion 1 - Todos											opcion 7 - 
	# opcion 2 - idsucursal									opcion 8 -
	# opcion 3 - iddepto
	# opcion 4 - iddepto y idsucursal
	# opcion 5 - codigo	
	SELECT
		entrada.codigo as codigo,
		CONCAT(empleados.nombre," ",empleados.apellidos) as nombrecompleto,
		entrada.fecha as fecha,
		entrada.horaentrada as hrentrada,
		entrada.idsucursal as idsucent,
		entrada.sucursal as sucursalent,
		salida.fecha as fechasalida,
		MAX(salida.horasalida) as hrsalida,
		salida.idsucursal as idsucsal,
		salida.sucursal as sucursalsal
	FROM v_listar_registros_entrada AS entrada
	LEFT JOIN v_listar_registros_salida AS salida ON entrada.fecha = salida.fecha AND entrada.codigo = salida.codigo
	LEFT JOIN tbempleados AS empleados ON entrada.codigo = empleados.codigo	
	WHERE entrada.fecha BETWEEN xfechaini AND xfechafin
		AND 
			CASE xopcion
				WHEN 1 THEN entrada.idsociedad = 1
				WHEN 2 THEN empleados.idsucursal = xidsucursal
				WHEN 3 THEN empleados.iddepto = xiddepto
				WHEN 4 THEN empleados.iddepto = xiddepto and empleados.idsucursal = xidsucursal
				WHEN 5 THEN empleados.codigo = xcodigo COLLATE utf8_unicode_ci
			END
	GROUP BY fecha, codigo 
	ORDER BY codigo	
;END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `SP_Mostrar_Registros_ES`;
DELIMITER |
CREATE PROCEDURE `SP_Mostrar_Registros_ES`(IN `xfechaini` date,IN `xfechafin` date, IN `xopcion` int(1), IN `xidsucursal` int(2), IN `xiddepto` int(2), IN `xcodigo` VARCHAR(4))
BEGIN
	#Routine body goes here...
	# opcion 1 - Todos											opcion 7 - 
	# opcion 2 - idsucursal									opcion 8 -
	# opcion 3 - iddepto
	# opcion 4 - iddepto y idsucursal
	# opcion 5 - codigo
	SELECT
		tbregistros.idregistros AS idregistro,
		tbregistros.codigo as codigo,
		CONCAT(tbempleados.nombre," ",tbempleados.apellidos) as nombre,
		DATE(fechahorareg) as fecha,
		TIME(fechahorareg) as hora,		
		(CASE 
			WHEN xopcion in(1,2,3,4,5) 
				THEN (CASE tbregistros.`status` WHEN 1 THEN "ENTRADA" WHEN 2 THEN "SALIDA" END)
			WHEN xopcion in(7,8) 
				THEN (CASE tbregistros.`status` WHEN 3 THEN "ENTRADA VISITA" WHEN 4 THEN "SALIDA VISITA" END)
		END) as estado,
		tbregistros.fechahorareg AS fechahorareg,
		tbregistros.`status` as estadoval,
		tbregistros.idsucursal AS idsucursal,
		tbsucursales.sucursal AS sucursalreg,
		tbregistros.sync AS sync		
		FROM tbregistros
		LEFT JOIN tbempleados on tbregistros.codigo = tbempleados.codigo
		LEFT JOIN tbsucursales on tbregistros.idsucursal = tbsucursales.idsucursal		
		WHERE fechahorareg BETWEEN xfechaini AND DATE_ADD(xfechafin,INTERVAL 1 DAY)	
			AND CASE xopcion
					WHEN 1 THEN tbregistros.idsociedad = 1
					WHEN 2 THEN tbempleados.idsucursal = xidsucursal OR tbregistros.idsucursal = xidsucursal
					WHEN 3 THEN tbempleados.iddepto = xiddepto
					WHEN 4 THEN tbempleados.iddepto = xiddepto and tbempleados.idsucursal = xidsucursal
					WHEN 5 THEN tbempleados.codigo = xcodigo COLLATE utf8_unicode_ci
					WHEN 6 THEN tbregistros.sync = 0
				END				
			AND tbregistros.activo = 1
			AND CASE  
					WHEN xopcion in(1,2,3,4,5) THEN tbregistros.`status` in (1,2) 
					WHEN xopcion in(7,8) THEN tbregistros.`status` in (3,4)
				END		
		ORDER BY codigo, fecha, hora
;END |
DELIMITER ;

