DROP PROCEDURE IF EXISTS `SP_Mostrar_Usuarios_Login`;
DELIMITER |
CREATE PROCEDURE `SP_Mostrar_Usuarios_Login`(IN `xusuario` varchar(20),IN `xclave` varchar(100))
BEGIN
